import React from "react";
import Link from "next/link";

export const Users = (props) => {
  console.log(props, "de users");

  return (
    <div>
      <h1>{props.users[0].name}</h1>

      <ul>{userMap(props)}</ul>
    </div>
  );
};

function userMap(props) {
  let users = "";
  props.users.forEach((element) => {
    users += <li>{element.name}</li>;
    console.log(element.name, "muestra");
  });
  return users;
}

export default Users;
